script: |
  super -f text -I q352.spq | sort > q352.out

inputs:
  - name: q352.spq
    data: |
      SELECT DISTINCT + col2 * - - ( - col2 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL IS NULL AND NOT - col1 * - - 54 IS NULL;
  - name: tab0

outputs:
  - name: q352.out
    data: |
      -100
      -2209
      -9801
